import React from "react";
import DataTable from "react-data-table-component";
import { useSelector } from "react-redux";

const ProductList = () => {
  const products = useSelector((state) => state.products.products);

  const columns = [
    {
      name: "Name",
      selector: "name",
      sortable: true,
    },
    {
      name: "vendors",
      selector: `${products?.vendors?.length}`,
      sortable: true,
    },
    {
      name: "Age",
      selector: "variants",
      sortable: true,
    },
  ];

  return (
    <div>
      <DataTable
        title="Product Data"
        columns={columns}
        data={products}
        pagination
      />
    </div>
  );
};

export default ProductList;
